import {
  Layout,
  Menu,
  Input,
  Row,
  Col,
  Button,
  Modal,
  Card,
  Table,
  Checkbox,
  Space,
  Typography
} from 'antd'
import './PayPage.css'
import {
  BellOutlined,
  UserOutlined,
  LogoutOutlined,
  PlusOutlined,
  DownloadOutlined,
  EyeOutlined 
} from '@ant-design/icons'
import { Link } from 'react-router-dom'
import logo from '../../Assets/download.png'

export const PayPage = () => {
  const { Header, Content, Footer } = Layout

  const { Title } = Typography

  const dataSource = [
    {
      key: '1',
      refer: '2021OCT_HCI',
      year: '2021',
      month: 'October',
      from: "01-10-2021",
      to: "31-10-2021"

    },
    {
      key: '2',
      refer: '2021SEPT_HCI',
      year: '2021',
      month: 'September',
      from: "01-09-2021",
      to: "30-09-2021"
    },
    {
      key: '3',
      refer: '2021AUG_HCI',
      year: '2021',
      month: 'August',
      from: "01-08-2021",
      to: "31-08-2021"
    },
    {
      key: '4',
      refer: '2021JULY_HCI',
      year: '2021',
      month: 'July',
      from: "01-07-2021",
      to: "31-07-2021"
    },
    {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
      {
        key: '4',
        refer: '2021JULY_HCI',
        year: '2021',
        month: 'July',
        from: "01-07-2021",
        to: "31-07-2021"
      },
  ]

  const columns = [
    {
      title: 'PaySlip Reference',
      dataIndex: 'refer',
      key: 'refer'
    },
    {
      title: 'Year',
      dataIndex: 'year',
      key: 'year'
    },
    {
      title: 'Month',
      dataIndex: 'month',
      key: 'month'
    },
    {
      title: 'Date From',
      dataIndex: 'from',
      key: 'from'
    },
    {
      title: 'Date To',
      dataIndex: 'to',
      key: 'to'
    },
    {
        title: 'Action',
        dataIndex: '',
        key: 'x',
        render: () => (
          <Button
            icon={<EyeOutlined />}
          ></Button>
        )
      }

  ]

  return (
    <Layout>
      <Header style={{ background: '#fff' }}>
        <img className='logo' src={logo} />
        <div style={{ fontWeight: 700 }}>WELCOME AH BOY</div>
      </Header>
      <Row style={{ background: '#001529' }}>
        <Col span={12}>
          <Menu
            theme='dark'
            style={{ marginTop: 10 }}
            mode='horizontal'
            defaultSelectedKeys={['1']}
          >
            <Menu.Item className='items'>
            <Link to='/'>Home</Link>
            </Menu.Item>
            <Menu.Item className='items'>Leaves</Menu.Item>
            <Menu.Item className='items'>Claims</Menu.Item>
            <Menu.Item className='items'>Payslips</Menu.Item>
          </Menu>
        </Col>
        <Col span={3}>
          <Button
            className='avatar'
            icon={<LogoutOutlined />}
            style={{ background: '#c4c4c4' }}
          >
            Log Out
          </Button>

          {/*<Dropdown overlay={menu} placement='bottomLeft'>
        <Avatar className='avatar' icon={<UserOutlined />} />
  </Dropdown>*/}
        </Col>
      </Row>
      <Content className='layout'>
        <Row>
          <Title>My Payslips</Title>
          <Button icon={<DownloadOutlined />} className='button'></Button>
        </Row>

        <Table
          dataSource={dataSource}
          columns={columns}
          pagination={false}
          scroll={{ y: 350 }}
        />
      </Content>
      <Footer style={{textAlign:'center'}}>Team 08</Footer>
    </Layout>
  )
}

export default PayPage
